import Vue from 'vue'
import Vuex from 'vuex'
import { doc, getDoc } from "firebase/firestore"
import { auth, db } from "../firebase/firebaseInit.js"
import createPersistedState from "vuex-persistedstate";

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    user: null,
    profileAdmin: null,
    profileEmail: null,
    profileFirstName: null,
    profileLastName: null,
    profileUsername: null,
    profileId: null,
    cart: [
      {
        itemName: "Stainless Steel Orbiter Ring",
        itemType: "rings",
        itemPrice: 15.00,
        itemDiscount: 0.1,
        metalMaterial: "Stainless Steel",
        filters: [
          "Space",
          "Planet",
        ],
        itemTotalQuantity: 52,
        itemSizes: {
          1: 2,
          2: 0,
          3: 4,
          4: 3,
          5: 5,
          6: 2,
          7: 1,
          8: 5,
          9: 6,
          10: 4,
          11: 5,
          12: 12,
          13: 1,
          14: 1,
          15: 1,
        },
        itemPictures: [
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
        ],
        oneOfAKind: true,
        popularity: 0,
        timeAdded: "April 26, 2022 at 10:23:24 PM UTC-7",
      },
    ],
    currentItem: null,
  },
  mutations: {
    updateUser(state, payload) {
      state.user = payload
    },
    setProfileInfo(state, payload) {
      state.profileId = payload.id
      state.profileEmail = payload.data().email;
      state.profileFirstName = payload.data().firstName;
      state.profileLastName = payload.data().lastName;
      state.profileUsername = payload.data().username;
    },
    setProfileAdmin(state, payload) {
      state.profileAdmin = payload
      console.log(payload)
    },
    setCurrentItem(state, payload) {
      state.currentItem = payload
      console.log("state committing", payload)
    }
  },
  actions: {
    async getCurrentUser({ commit }, user) {
      const userID = auth.currentUser.uid;
      const docRef = doc(db, 'users', userID)
      const currentDoc = await getDoc(docRef);
      commit("setProfileInfo", currentDoc)
      const token = await user.getIdTokenResult()
      const admin = await token.claims.admin;
      commit('setProfileAdmin', admin)
    }
  },
  modules: {
  },
  plugins: [createPersistedState()]
})
